async def x_manage_users__mutmut_orig(container: ServiceContainer) -> None:
    service = container.user_service
    while True:
        print_header("Usurios")
        print("1. Listar usurios")
        print("2. Criar usurio")
        print("0. Voltar")
        choice = input("> ").strip()
        if choice == "1":
            users = await service.list_users()
            if not users:
                print("Nenhum usurio cadastrado.")
            for user in users:
                print(f"- {user.id} | {user.name} | {user.email} | {user.default_currency}")
            pause()
        elif choice == "2":
            name = input("Nome: ").strip()
            email = input("E-mail: ").strip()
            currency = input(f"Moeda padro [{CurrencyCode.BRL.value}]: ").strip() or CurrencyCode.BRL.value
            try:
                await service.create_user(UserCreate(name=name, email=email, default_currency=currency))
                print("Usurio criado com sucesso!")
            except Exception as exc:
                print(f"Erro: {exc}")
            pause()
        elif choice == "0":
            break
        else:
            print("Opo invlida.")


