async def x_manage_accounts__mutmut_orig(container: ServiceContainer) -> None:
    service = container.account_service
    user_service = container.user_service
    while True:
        print_header("Contas")
        print("1. Listar contas")
        print("2. Criar conta")
        print("0. Voltar")
        choice = input("> ").strip()
        if choice == "1":
            accounts = await service.list_accounts()
            if not accounts:
                print("Nenhuma conta cadastrada.")
            for account in accounts:
                print(
                    f"- {account.id} | Usurio: {account.user_id} | {account.name} | "
                    f"{account.account_type} | Saldo: {account.balance}"
                )
            pause()
        elif choice == "2":
            users = await user_service.list_users()
            if not users:
                print("Cadastre um usurio antes de criar contas.")
                pause()
                continue
            for idx, user in enumerate(users, start=1):
                print(f"{idx}. {user.name} ({user.email})")
            selected = int(input("Selecione o usurio: ").strip())
            target_user = users[selected - 1]
            name = input("Nome da conta: ").strip()
            account_type = input(f"Tipo [{AccountType.CHECKING.value}]: ").strip() or AccountType.CHECKING.value
            currency = input(f"Moeda [{CurrencyCode.BRL.value}]: ").strip() or CurrencyCode.BRL.value
            description = input("Descrio (opcional): ").strip()
            starting_balance = Decimal(input("Saldo inicial [0]: ") or "0")
            minimum_balance = Decimal(input("Saldo mnimo [0]: ") or "0")
            try:
                await service.create_account(
                    AccountCreate(
                        user_id=target_user.id,
                        name=name,
                        account_type=account_type,
                        currency=currency,
                        description=description or None,
                        starting_balance=starting_balance,
                        minimum_balance=minimum_balance,
                    )
                )
                print("Conta criada com sucesso!")
            except AppException as exc:
                print(f"Erro: {exc.message}")
            pause()
        elif choice == "0":
            break
        else:
            print("Opo invlida.")


