async def x_show_report__mutmut_orig(container: ServiceContainer) -> None:
    users = await container.user_service.list_users()
    if not users:
        print("Cadastre um usurio primeiro.")
        pause()
        return
    for idx, user in enumerate(users, start=1):
        print(f"{idx}. {user.name}")
    user = users[int(input("Usurio: ").strip()) - 1]
    year = int(input("Ano: ").strip())
    month = int(input("Ms: ").strip())
    summary = await container.report_service.monthly_summary(user.id, year, month)
    print_header("Relatrio Mensal")
    print(f"Usurio: {user.name} | Perodo: {month:02d}/{year}")
    print("\nTotais por tipo:")
    for key, value in summary.totals_by_type.items():
        print(f"- {key}: {value}")
    print("\nCategorias:")
    for category in summary.categories:
        print(
            f"- {category.name} ({category.transaction_type}) | Total: {category.total} | "
            f"Transaes: {category.count} | Budget: {category.budget_amount or '-'} | "
            f"Restante: {category.budget_remaining or '-'}"
        )
    pause()


